 "Correct Location (y)": "Sitio correcto (y)", 
 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p><p>More than one possible answer can be defined enclosing them with pipes (|). I.e.: |dog|cat|bird|<\/p>": "<p>Escriba el texto para la actividad de rellenar huecos dentro del campo en blanco \nbien pegando texto de otra fuente o tecleando el texto directamente en el campo.<\/p>\n<p>Para seleccionar las palabras que desea ocultar, haga doble clic en la palabra para seleccionarla,\ny pulse en el bot\u00f3n Ocultar\/Mostrar palabra de abajo.<\/p><p>Puede definir m\u00e1s de una respuesta posible si est\u00e1n rodeadas con el signo de la tuber\u00eda (|). P.ej.: |perro|gato|p\u00e1jaro|<\/p>", 
