 "Checking this option, a \"Page X of Y.\" text will be added to every page of the exported content (except ePub's frontpage). This doesn't affect Single Page and Text File export files.": "Marcando esta opci\u00f3n, se a\u00f1adir\u00e1 un texto \"P\u00e1gina X de Y.\"  a cada p\u00e1gina del contenido exportado (excepto la portada de un ePub). No afecta a ficheros exportados como P\u00e1gina html \u00fanica ni como Ficheros de texto plano.", 
 "Indicate a valid URL of an image or select one from your device": "Indique la URL v\u00e1lida de una imagen o seleccione una de su dispositivo", 
 "Use the $ option after recording to define the authorship or the audio title.": "Use la opci\u00f3n $ despu\u00e9s de grabar para definir el t\u00edtulo y la autor\u00eda.", 
 "%prog, the commandline version of eXe.\nUsage: %prog [options] input_file [output_file]\n\nTo show help:\n%prog -h": "%prog, la versi\u00f3n de eXe para l\u00ednea de \u00f3rdenes.\nUso: %prog [opciones] fichero_de_entrada [fichero_de_salida]\n\nPara ver la ayuda:\n%prog -h", 
 "SCORM Options (1.2 and 2004)": "Opciones SCORM (1.2 y 2004)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text that are key to understanding the concepts. These will probably be verbs, nouns, and key adverbs. Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl><dt>Si su objetivo es evaluar la comprensi\u00f3n de conceptos clave o la comprensi\u00f3n lectora<\/dt><dd><p>  Escriba un resumen del concepto o lectura lo suficientemente largo como para que eval\u00fae adecuadamente el conocimiento del objetivo, pero lo suficientemente corto como para que no produzca fatiga. Probablemente algo menos de una p\u00e1gina impresa sea un tama\u00f1o adecuado, pero considere la posibilidad de utilizar un texto menor para ni\u00f1os o principiantes.<\/p> <p>Elija palabras del texto que sean claves para la comprensi\u00f3n de los conceptos. Estas ser\u00e1n probablemente verbos, sustantivos y adverbios clave. Escoja alternativas con una respuesta clara.<\/p><\/dd> <dt>Si su objetivo es evaluar el conocimiento de vocabulario<\/dt><dt>Si su objetivo es evaluar morfolog\u00eda o gram\u00e1tica: <\/dt><dd><p>Escriba un texto en el que se usen las formas que quiere evaluar. Este texto debe ser coherente y de sentido completo, y de una longitud apropiada. Recuerde que en este caso el objetivo no es evaluar el conocimiento de vocabulario, y por tanto los significados b\u00e1sicos de las ra\u00edces deben ser bien conocidos por los estudiantes.<\/p>  <p>Destaque las palabras que quiere trabajar en el texto. Proporcione alternativas con las mismas ra\u00edces, pero afijos diferentes. \u00a1Es buena idea pedir a un compa\u00f1ero docente que realice el control\/ejercicio, para asegurarse de que no se producen sorpresas!<\/p><\/dd><\/dl>", 
