 "Provide instruction on how the cloze activity should be \ncompleted. Default text will be entered if there are no changes to this field.\n": "Puede proporcionar instrucciones sobre c\u00f3mo deber\u00e1 completarse la actividad de rellenar huecos.\nSe insertar\u00e1 un texto por defecto si no hay cambios en este campo.\n", 
