 "prove": "comprobar", 
 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Si no se selecciona, se aceptar\u00e1 un peque\u00f1o n\u00famero de errores ortogr\u00e1ficos y de uso de may\u00fasculas y min\u00fasculas. Si est\u00e1 marcado, no se aceptar\u00eda ning\u00fan error ortogr\u00e1fico o de uso de may\u00fasculas o min\u00fasculas.<\/p><p><strong>Ejemplo:<\/strong>: Si la respuesta correcta es <code>Elefante<\/code> y pone <code>elefante<\/code> o <code>Elifante<\/code>, ambos ser\u00e1n considerados como <em>\"bastantes cercanos\"<\/em> por el algoritmo, pues existe solo un error de letra, incluso si \"\u00bfComprobar may\u00fasculas\/min\u00fasculas?\" est\u00e1 activado.<\/p><p>Si el chequeo de may\u00fasculas y min\u00fasculas est\u00e1 desactivado en este ejemplo, la letra min\u00fascula <code>e<\/code> no es considerada un error y <code>eliphant<\/code> tambi\u00e9n ser\u00e1 aceptado.<\/p><p>Si \"\u00bfCalificaci\u00f3n Estricta?\" y \"\u00bfComprobar may\u00fasculas\/min\u00fasculas?\" est\u00e1n activados, la \u00fanica respuesta correcta es \"Elefante\". Si solamente \"\u00bfCalificaci\u00f3n Estricta?\" est\u00e1 activado y \"\u00bfComprobar may\u00fasculas\/min\u00fasculas?\" no, \"elefante\" tambi\u00e9n ser\u00e1 aceptado.<\/p>", 
